import { Route, Routes } from "react-router";
import Welcome from "./Pages/Welcome";
import Users from "./Pages/Users";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/welcome">
          <Welcome />
        </Route>
        <Route path="/users">
          <Users />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
